import React from 'react';
import { connect } from 'react-redux';
import createTodoContainer from '../containers/createTodo.container';
import 'bootstrap/dist/css/bootstrap.min.css';
import { PropTypes } from 'prop-types';


const CreateTodo = ({submit, changeTodoDescription, changeTodoResponsible, changeTodoPriority}) => {
    return (
        <div className='container'>
            <h3 style={{marginBottom: 20,}}>Create Todo</h3>
            <div className='row'>
                <form onSubmit={submit}>
                    <div className='form-group'>
                        <label>Description:</label>
                        <input 
                            type='text' 
                            placeholder='Input description' 
                            className='form-control' 
                            id='description' 
                            onChange={changeTodoDescription}
                        />
                    </div>
                    <div className='form-group'>
                        <label>Responsible:</label>
                        <input 
                            type='text'
                            placeholder='Input responsible' 
                            className='form-control' 
                            id='responsible'
                            onChange={changeTodoResponsible} 
                        />
                    </div>
                    <div className='form-group'>
                        <label>Priority:</label>
                        <input 
                            type='radio' 
                            className='form-check-input' 
                            id='priority' 
                            onChange={changeTodoPriority}
                        />
                    </div>
                    <button type='submit' className='btn btn-primary'>Create</button>
                </form>
            </div>
        </div>
    )
}

CreateTodo.propTypes = {
    changeTodoDescription: PropTypes.func.isRequired,
    changeTodoPriority: PropTypes.func.isRequired,
    changeTodoResponsible: PropTypes.func.isRequired,
    submit: PropTypes.func.isRequired
};

export default connect(null, createTodoContainer.mapDispatchToProps)(CreateTodo);
